﻿<html xmlns="http://www.w3.org/1999/xhtml">
    <head>
        <meta charset="utf-8" />
        <meta http-equiv="X-UA-Compatible" content="IE=edge" />
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <!-- The above 3 meta tags *must* come first in the head; any other head content must come *after* these tags -->
        <meta name="description" content="" />
        <meta name="author" content="" />
        <link rel="icon" href="/favicon.ico" />
        <title>Site Maintenance</title>
        <link href="//fonts.googleapis.com/css?family=Raleway:400,300,500,600,700" rel="stylesheet" type="text/css"/>
        <link href="//fonts.googleapis.com/css?family=Cinzel:400,700" rel="stylesheet" type="text/css" />
        <style type="text/css">
            /* Base Styles */
            body {
                color: #333;
                display: block;
                font-family: "Raleway",Helvetica,Arial,sans-serif;
                font-size: 14px;
                line-height: 1.42857;
                margin: 0;
                }
            #maintenance {
                background: url('maintenance.jpg') 40% 0 no-repeat fixed;
                background-size: cover;
                }
            * {-webkit-box-sizing: border-box; -moz-box-sizing: border-box; box-sizing: border-box; }
            header {background-color: #132450; display: block;}
            .bannerText {
                background-color: rgba(7,14,31,0.9);
                color: #fff;
                margin-top: 40%;
                text-align: center;
                width: 100%;
                }
            h1 {
	            font-family: "Cinzel",Georgia,"Times New Roman",Times,serif;
                font-size: 3em;
                font-weight: normal;
                line-height: 1.2em;
                margin: 0;
                padding: 20px 0 10px;
                }
            p {
                font-size: 1.5em; 
                margin-top: 0;
                padding: 0 15px;
                }
            .generalCourt {
                background-color: #091127;
	            font-family: "Cinzel",Georgia,"Times New Roman",Times,serif;
                font-size: 1em;
                padding: 15px 15px;
                }
            /* Responsive Styles */
            @media (min-width: 768px) {
                .container {width: 750px;}
                .masthead {
                    background-color: transparent;
                    display: inline-block;
                    font-size: 1.1em;
                    margin: 0;
                    padding: 10px;
                    text-align: left;
                    }
                .masthead .headCommonwealth {font-size: 1.55em;}
                .masthead .headMass {font-size: 1.7em; line-height: 0.8em;}
                .bannerText {margin-top: 30%;}
                h1 {font-size: 5em;}
                p {font-size: 1.8em;}
                }
            @media (min-width: 992px) {
                .container {width: 970px;}
                .masthead {font-size: 1.4em;}
                h1 {font-size: 7em;}
                p {font-size: 2em;}
                .generalCourt {font-size: 1.2em;}
                }
            @media (min-width: 1200px) {
                .container {width: 1170px;}
                }
        </style>
    </head>
    <body id="maintenance">
        <div class="bannerText">
            <h1>Site Maintenance</h1>
            <p>We are currently updating the website to better serve you. Please check back soon.</p>
            <p class="generalCourt">The General Court of the Commonwealth of Massachusetts</p>
        </div>
    </body>
</html>
